            array('id' => '7','slug' => 'privacy-policy','title' => '{"language":{"en":{"title":"Privacy Policy"},"es":{"title":"pol\\u00edtica de privacidad"},"hi":{"title":"\\u0917\\u094b\\u092a\\u0928\\u0940\\u092f\\u0924\\u093e \\u0928\\u0940\\u0924\\u093f"},"ar":{"title":"\\u0633\\u064a\\u0627\\u0633\\u0629 \\u0627\\u0644\\u062e\\u0635\\u0648\\u0635\\u064a\\u0629"}}}','type' => 'useful-links','details' => '{"language":{"en":{"details":"<p><span style=\\"color:rgb(209,210,211);\\">At Rentify, we are committed to protecting your privacy and ensuring the security of your personal information. This Privacy Policy outlines the types of information we collect, how it is used, and the measures we take to safeguard your data.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">1. Information We Collect:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - We may collect personal information, including but not limited to names, contact details, payment information, and rental history, to facilitate the car rental process.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">2. How We Use Your Information:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - Your information is used for reservation purposes, communication, and improving our services. We may also use your data for marketing communications with your consent.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">3. Information Security:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - We employ industry-standard security measures to protect your information from unauthorized access, disclosure, alteration, and destruction.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">4. Third-Party Sharing:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - We do not sell or rent your personal information to third parties. However, we may share information with trusted partners to facilitate services such as payment processing and vehicle maintenance.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">5. Cookies and Tracking:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - We use cookies and similar technologies to enhance your browsing experience. You can manage cookie preferences through your browser settings.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">6. Your Choices:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - You have the right to review, update, and delete your personal information. You can also opt-out of marketing communications at any time.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">7. Children\\u2019s Privacy:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - Our services are not directed at individuals under the age of 18. We do not knowingly collect personal information from children.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">8. Changes to Privacy Policy:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - We reserve the right to update our Privacy Policy. Changes will be communicated through our website, and your continued use of our services implies acceptance of the updated policy.<\\/span><br><span style=\\"color:rgb(209,210,211);\\">9. Contact Us:<\\/span><br><span style=\\"color:rgb(209,210,211);\\">&nbsp; - If you have questions or concerns about our Privacy Policy, please contact us at [your contact email\\/phone].<\\/span><\\/p>"},"es":{"details":"<p>En Rentify, estamos comprometidos a proteger tu privacidad y garantizar la seguridad de tu informaci\\u00f3n personal. Esta Pol\\u00edtica de Privacidad describe los tipos de informaci\\u00f3n que recopilamos, c\\u00f3mo se utiliza y las medidas que tomamos para salvaguardar sus datos.<br>1. Informaci\\u00f3n que recopilamos:<br>&nbsp; &nbsp;- Podemos recopilar informaci\\u00f3n personal, incluidos, entre otros, nombres, datos de contacto, informaci\\u00f3n de pago e historial de alquiler, para facilitar el proceso de alquiler del veh\\u00edculo.<br>2. C\\u00f3mo utilizamos su informaci\\u00f3n:<br>&nbsp; &nbsp;- Su informaci\\u00f3n se utiliza con fines de reserva, comunicaci\\u00f3n y mejora de nuestros servicios. Tambi\\u00e9n podemos utilizar sus datos para comunicaciones de marketing con su consentimiento.<br>3. Seguridad de informaci\\u00f3n:<br>&nbsp; &nbsp;- Empleamos medidas de seguridad est\\u00e1ndar de la industria para proteger su informaci\\u00f3n contra acceso no autorizado, divulgaci\\u00f3n, alteraci\\u00f3n y destrucci\\u00f3n.<br>4. Compartir con terceros:<br>&nbsp; &nbsp;- No vendemos ni alquilamos su informaci\\u00f3n personal a terceros. Sin embargo, podemos compartir informaci\\u00f3n con socios confiables para facilitar servicios como el procesamiento de pagos y el mantenimiento del veh\\u00edculo.<br>5. Cookies y seguimiento:<br>&nbsp; &nbsp;- Utilizamos cookies y tecnolog\\u00edas similares para mejorar su experiencia de navegaci\\u00f3n. Puede administrar las preferencias de cookies a trav\\u00e9s de la configuraci\\u00f3n de su navegador.<br>6. Tus opciones:<br>&nbsp; &nbsp;- Tienes derecho a revisar, actualizar y eliminar tu informaci\\u00f3n personal. Tambi\\u00e9n puede optar por no recibir comunicaciones de marketing en cualquier momento.<br>7. Privacidad de los ni\\u00f1os:<br>&nbsp; &nbsp;- Nuestros servicios no est\\u00e1n dirigidos a personas menores de 18 a\\u00f1os. No recopilamos conscientemente informaci\\u00f3n personal de ni\\u00f1os.<br>8. Cambios en la Pol\\u00edtica de Privacidad:<br>&nbsp; &nbsp;- Nos reservamos el derecho de actualizar nuestra Pol\\u00edtica de Privacidad. Los cambios se comunicar\\u00e1n a trav\\u00e9s de nuestro sitio web, y su uso continuado de nuestros servicios implica la aceptaci\\u00f3n de la pol\\u00edtica actualizada.<br>9. Cont\\u00e1ctenos:<br>&nbsp; &nbsp;- Si tiene preguntas o inquietudes sobre nuestra Pol\\u00edtica de Privacidad, comun\\u00edquese con nosotros al [su correo electr\\u00f3nico\\/tel\\u00e9fono de contacto].<\\/p>"},"hi":{"details":"<p>\